style.css:
/* Google ana sayfası ve arama sonuçları için siyah arka plan ve modern daktilo yazı tipi */
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("google.com") {
/* Arka plan ve yazı rengi ayarları */
    body {
        background-color: #000 !important; /* Siyah arka plan */
        color: #fff !important; /* Beyaz yazı rengi */
    }
    
    /* Google logosunu gizleme */
    .lnXdpd, .k1zIA.rSk4se {
        display: none !important;
    }
    
    /* Arama kutusu ve düğmeler */
    input[type="text"], input[type="search"], input[type="submit"], input[type="button"] {
        background-color: #333 !important; /* Koyu gri arka plan */
        color: #fff !important; /* Beyaz yazı rengi */
        border: 1px solid #555 !important; /* Gri kenarlık */
        font-family: "Courier New", Courier, monospace !important; /* Modern daktilo yazı tipi */
    }

    /* Genel yazı tipi ayarı */
    * {
        font-family: "Courier New", Courier, monospace !important; /* Modern daktilo yazı tipi */
    }
}
